import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    Avatar,
    Divider,
    List,
    Box,
    Typography,
    ListItemIcon
}
from '@material-ui/core';

import {
    ArrowBack,
    Home,
    Apps,
    ContactMail,
    AssignmentInd

} from '@material-ui/icons';
import avatar from '../avatar.png'

//CSS STYLES

const useStyles = makeStyles(theme=>({
    menuSliderContainer: {
      background: '#511',
      height:'30rem',
      width:250
    },
    avatar:{
         display:'block',
         margin:'0.5rem auto',
         width:theme.spacing(13),
         height:theme.spacing(13)
    }
  }));

  const menuIcons=[
      {
          listIcon:<Home/>,
          listText:'Home'
      }
  ]


export default function Navbar() {
    const classes = useStyles()
    return (


       <>
        <Box component='div' className={classes.menuSliderContainer}>
                  <Avatar className={classes.avatar} src={avatar} alt='error'/>   
                  <Divider/>
                  <List>
                          <ListItem>
                                      <ListItemIcon>

                                      </ListItemIcon>
                          </ListItem>     
                 </List>  
        </Box>
        <Box component='nav'>
                 <AppBar position='static' style={{background:'#222'}}>
                       <Toolbar>

                             <IconButton>
                                                <ArrowBack style={{color:'tomato'}}/>
                             </IconButton>
                              
                                 <Typography variant='h5' style={{color:'tan'}}>
                                             Portfolio                  
                                </Typography>        
                              
                       </Toolbar>
                 </AppBar>
        </Box>
        </>
    )
}
